import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { FiMapPin, FiStar, FiFilter, FiClock } from 'react-icons/fi';
import './DineOut.css';

const DineOut = () => {
  const [activeTab, setActiveTab] = useState('dineout');
  const [restaurants, setRestaurants] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filters, setFilters] = useState({
    filter: false,
    sortBy: false,
    bookTable: false,
    within5km: false,
    rating4Plus: false,
    pureVeg: false
  });

  // Mock data for restaurants
  const mockRestaurants = [
    {
      id: 1,
      name: 'Saladish',
      image: 'https://images.unsplash.com/photo-1498837167922-ddd27525d352',
      cuisine: 'Healthy Food • Fast Food',
      location: 'Begampura, Surat',
      distance: '0.2 km',
      rating: 4.6,
      priceForTwo: '₹500 for two',
      hasTableBooking: true,
      discount: 'Flat 15% off on walk-in',
      moreOffers: '+ 1 more',
      bankOffer: 'Up to 10% off with bank offers',
      isVeg: true
    },
    {
      id: 2,
      name: 'Classic Chicken Mamma',
      image: 'https://images.unsplash.com/photo-1544025162-d76694265947',
      cuisine: 'North Indian • Mughlai',
      location: 'Zampa Bazar, Surat',
      distance: '0.4 km',
      rating: 3.4,
      priceForTwo: '₹500 for two',
      hasTableBooking: true,
      discount: 'Flat 15% off on walk-in',
      moreOffers: '+ 3 more',
      bankOffer: 'Up to 10% off with bank offers',
      isVeg: false
    },
    {
      id: 3,
      name: 'Broast N Rolls',
      image: 'https://images.unsplash.com/photo-1550547660-d9450f859349',
      cuisine: 'Fast Food',
      location: 'Begampura, Surat',
      distance: '1 km',
      rating: 4.5,
      priceForTwo: '₹500 for two',
      hasTableBooking: true,
      discount: 'Flat 30% off on pre-booking',
      moreOffers: '+ 3 more',
      bankOffer: 'Up to 10% off with bank offers',
      isVeg: false
    }
  ];

  useEffect(() => {
    // Simulate API call
    setTimeout(() => {
      setRestaurants(mockRestaurants);
      setLoading(false);
    }, 1000);
  }, []);

  const handleFilterClick = (filterName) => {
    setFilters(prev => ({
      ...prev,
      [filterName]: !prev[filterName]
    }));
  };

  return (
    <div className="dine-out-page">
      {/* Tabs */}
      <div className="page-tabs">
        <Link 
          to="/restaurants/order-online"
          className={`tab ${activeTab === 'order' ? 'active' : ''}`}
          onClick={() => setActiveTab('order')}
        >
          Order Online
        </Link>
        <Link 
          to="/restaurants/dine-out"
          className={`tab ${activeTab === 'dineout' ? 'active' : ''}`}
          onClick={() => setActiveTab('dineout')}
        >
          Dineout
        </Link>
      </div>

      {/* Filters */}
      <div className="filters-container">
        <button className={`filter-btn ${filters.filter ? 'active' : ''}`} onClick={() => handleFilterClick('filter')}>
          <span className="filter-count">1</span> Filter <FiFilter />
        </button>
        <button className={`filter-btn ${filters.sortBy ? 'active' : ''}`} onClick={() => handleFilterClick('sortBy')}>
          Sort By
        </button>
        <button className={`filter-btn ${filters.bookTable ? 'active' : ''}`} onClick={() => handleFilterClick('bookTable')}>
          Book a table
        </button>
        <button className={`filter-btn ${filters.within5km ? 'active' : ''}`} onClick={() => handleFilterClick('within5km')}>
          Within 5km
        </button>
        <button className={`filter-btn ${filters.rating4Plus ? 'active' : ''}`} onClick={() => handleFilterClick('rating4Plus')}>
          Rating 4+
        </button>
        <button className={`filter-btn ${filters.pureVeg ? 'active' : ''}`} onClick={() => handleFilterClick('pureVeg')}>
          Pure Veg
        </button>
      </div>

      {/* Restaurant Cards */}
      <div className="restaurants-grid">
        {loading ? (
          <div className="loading">Loading restaurants...</div>
        ) : (
          restaurants.map(restaurant => (
            <div key={restaurant.id} className="restaurant-card">
              <div className="restaurant-image">
                <img src={restaurant.image} alt={restaurant.name} />
                <div className="restaurant-rating">
                  <span className={restaurant.rating >= 4 ? 'high' : 'medium'}>★ {restaurant.rating}</span>
                </div>
              </div>
              <div className="restaurant-details">
                <h3>{restaurant.name}</h3>
                <p className="cuisine">{restaurant.cuisine}</p>
                <p className="location">
                  <FiMapPin /> {restaurant.location} • {restaurant.distance}
                </p>
                <p className="price">{restaurant.priceForTwo}</p>
                {restaurant.hasTableBooking && (
                  <div className="table-booking">
                    <span>📅 Table booking</span>
                  </div>
                )}
                <div className="offers">
                  <div className="main-offer">
                    <span className="offer-icon">🏷️</span>
                    {restaurant.discount}
                    <span className="more-offers">{restaurant.moreOffers}</span>
                  </div>
                  <div className="bank-offer">
                    {restaurant.bankOffer}
                  </div>
                </div>
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default DineOut;
